import React from "react";
import HomePage from "./pages/HomePage";
import QuoteForm from './pages/QuoteForm';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return 
  <Router>
      <Routes>
  <HomePage />;
  <Route path="/devis" element={<QuoteForm />} />
  </Routes>
  </Router>
}

export default App;
